import React, { Fragment } from 'react';
import QuoteItem from './QuoteItem';

const Quotes = ({ quotes, count }) => {
  return (
    <Fragment>
      {/* {quotes.quotes.map(quote => (
        <QuoteItem quote={quote} />
      ))} */}
      <QuoteItem quote={quotes} />
    </Fragment>
  );
};

const quoteStyle = {
  display: 'flexbox',
  flexDirection: 'column'
};

export default Quotes;
